import React from 'react';
import {
  Button,
  Card,
  CardBody,
  CardFooter,
  CardTitle,
  Form,
  FormGroup,
  Input,
} from 'reactstrap';
import { Image, Navbar, Container, Nav } from 'react-bootstrap';
import './style.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';

const ComingSoon = () => {
  return (
      <div>
        <Card className="text-center" style={{width:'60rem', margin:'auto', marginTop:'5%', backgroundColor:'white', borderRadius:'10px'}}>
            <CardBody>
                <Navbar>
                    <Navbar.Brand href="#home">
                        <Image src="./img/KIPLogo.svg" style={{height:'50px', marginLeft:'20px'}}></Image>
                    </Navbar.Brand>
                    <Navbar.Toggle />
                    <Navbar.Collapse className="justify-content-end">
                        <Navbar.Text>
                            customer.service@kiptour.com
                        </Navbar.Text>
                    </Navbar.Collapse>
                </Navbar>
            </CardBody>
        </Card>
      </div>
  )
};

export default ComingSoon;
